DROP TABLE IF EXISTS `auth`;
CREATE TABLE `auth` (
  `id` int NOT NULL AUTO_INCREMENT,
  `email` char(100) NOT NULL,
  `password` char(64) NOT NULL,
  `role` smallint NOT NULL DEFAULT '1',
  `date_added` date NOT NULL,
  `username` char(100) DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `added_by` int NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `categories`;
CREATE TABLE `categories` (
  `user` int NOT NULL,
  `date_added` date DEFAULT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1',
  `id` int NOT NULL AUTO_INCREMENT,
  `category` char(200) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `category` (`category`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `comments`;
CREATE TABLE `comments` (
  `story` int NOT NULL,
  `user` int NOT NULL,
  `comment` text,
  `date_added` date NOT NULL,
  `id` int NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `stories`;
CREATE TABLE `stories` (
  `user` int NOT NULL,
  `status` tinyint(1) DEFAULT '1',
  `deleted` tinyint(1) DEFAULT '0',
  `date_modified` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `category` int NOT NULL,
  `title` char(200) NOT NULL,
  `url` char(200) NOT NULL,
  `story` longblob,
  `id` int NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`id`),
  UNIQUE KEY `url` (`url`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `story_files`;
CREATE TABLE `story_files` (
  `id` int NOT NULL AUTO_INCREMENT,
  `caption` char(200) DEFAULT NULL,
  `date_added` date NOT NULL,
  `deleted` tinyint(1) DEFAULT '0',
  `file_path` char(100) NOT NULL,
  `file_type` smallint DEFAULT NULL,
  `file_extension` char(100) NOT NULL,
  `user` int NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `story_update_logs`;
CREATE TABLE `story_update_logs` (
  `id` int NOT NULL AUTO_INCREMENT,
  `story` longblob,
  `editor` int NOT NULL,
  `date_added` date NOT NULL,
  `category` smallint NOT NULL,
  `title` char(100) NOT NULL,
  `story_id` int NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `user` int NOT NULL,
  `names` char(200) NOT NULL,
  `date_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `profile_pic` char(100) NOT NULL DEFAULT 'blank.png',
  `dob` date NOT NULL DEFAULT '1990-09-23',
  `contacts` char(100) NOT NULL,
  `nin` char(100) NOT NULL,
  `address` char(100) NOT NULL,
  `gender` char(2) NOT NULL DEFAULT 'M',
  PRIMARY KEY (`user`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

